export default {
  title: 'Captive Portal schema',
  type: 'object',
  properties: {
    enabled: { type: 'boolean' },
    acceptText: { type: 'string', required: false },
    messageHeading: { type: 'string', required: false },
    acceptButtonText: { type: 'string', required: false },
    messageText: { type: 'string', required: false },
    welcomeText: { type: 'string', required: false },
    timeoutValue: { type: 'number' },
    timeoutPeriod: { type: 'string' },
    rules: { type: 'array' },
    pageTitle: { type: 'string', required: true },
    logo: {
      type: 'object',
      properties: {
        imageData: {
          type: 'string',
        },
      },
      required: ['imageData'],
    },
  },
  required: ['enabled', 'timeoutValue', 'timeoutPeriod', 'logo'],
  additionalProperties: false,
}
